
class Mem {
    static get Instance() {
        if(!Mem.__instance) {
            const buffer = Uint8Array.from(
                atob(''),
                (m) => m.codePointAt(0)
            )
            const module = new WebAssembly.Module(buffer)
            const instance = new WebAssembly.Instance(module)
            Mem.__instance = instance.exports
        }
        return Mem.__instance
    }

    static Length() { return Mem.Instance.wlen() }
    static Alloc(size) { return Mem.Instance.walloc(size) }
    static Free(ptr, size) { return Mem.Instance.wfree(ptr, size) }
    static U8(ptr, size) { return new Uint8Array(Mem.Instance.memory.buffer, ptr, size) }
    static U32(ptr, size) { return new Uint32Array(Mem.Instance.memory.buffer, ptr, size) }

    static CopyAndFree(ptr, size) {
        let slice = Mem.U8(ptr, size).slice()
        return (Mem.Instance.wfree(ptr, size), slice)
    }

    static DecompressWith(buffer, transform) {
        const ptr = Mem.Alloc(buffer.length)
        Mem.U8(ptr, buffer.length).set(buffer)
        const x = Mem.Instance.decompress(ptr, buffer.length)
        if (0 === x) throw new Error('lz4: failed to decompress')

        const u8 = Mem.U8(x, Mem.Length())

        const value = transform(u8)
        return (Mem.Free(x, u8.length), value)
    }
    static DecompressRawWith(size, buffer, transform) {
        const ptr = Mem.Alloc(buffer.length)
        Mem.U8(ptr, buffer.length).set(buffer)
        const x = Mem.Instance.decompress_raw(size, ptr, buffer.length)
        if (0 === x) throw new Error('lz4: failed to decompress (raw)')

        const u8 = Mem.U8(x, Mem.Length())

        const value = transform(u8)
        return (Mem.Free(x, u8.length), value)
    }
}

class LZ4 {
    static Compress(buffer) {
        const ptr = Mem.Alloc(buffer.length)
        Mem.U8(ptr, buffer.length).set(buffer)
        return Mem.CopyAndFree(Mem.Instance.compress(ptr, buffer.length), Mem.Length())
    }
    static CompressRaw(buffer) {
        const ptr = Mem.Alloc(buffer.length)
        Mem.U8(ptr, buffer.length).set(buffer)
        return Mem.CopyAndFree(Mem.Instance.compress_raw(ptr, buffer.length), Mem.Length())
    }
    static Decompress(buffer) {
        return Mem.DecompressWith(buffer, x => x.slice())
    }
    static DecompressRaw(size, buffer) {
        return Mem.DecompressRawWith(size, buffer, x => x.slice())
    }
}

module.exports = LZ4